// Credit: https://craftpix.net/freebies/free-game-icons-of-fantasy-knight-armor-pack-11/
import SteelArmorImg from './steel-armor.png';

const SteelArmor = {
    name: 'Steel Armor',
    type: 'armor::body',
    effect: {
        defence: 15,
    },
    image: SteelArmorImg,
    value: 200,
};

export default SteelArmor;
